import Expenseitem from "./Expenseitem";
import App from "../App";

const ExpenseTask = (props) => {
  return ( 
    <div>
      <Expenseitem thatDay={[0].thatDay} title={[0].title} rate={[0].rate} />
      <Expenseitem thatDay={[1].thatDay} title={[1].title} rate={[1].rate}/>
      <Expenseitem thatDay={[2].thatDay} title={[2].title} rate={[2].rate}/>
      <Expenseitem thatDay={[3].thatDay} title={[3].title} rate={[3].rate}/>
      <Expenseitem thatDay={[4].thatDay} title={[4].title} rate={[4].rate}/>
    </div>
   );
}
 
export default ExpenseTask;
